import React from 'react';

const Footer = () => {
    return(
        <div className='footer'>
            <section style={{textAlign: 'left'}}>
            <h3>Dylan Collins</h3>
            <p>Copyright # 2020 Dylan Collins. All rights reserved.</p>
            <p style={{fontSize: '.8rem', color: '#BEBEBE'}}>Coded by Dylan Collins, designed by <a style={{color: 'blue', textDecoration: 'underline'}} href='#'>Marc Dandoy</a></p>
            </section>
            <section>
                <div>this is going other side</div>
            </section>
        </div>
    )
}

export default Footer;
